  \"fish-and-wildlife-coordination-act-report-fallon-indian-reservation-irrigation-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the project discussed in
  this report is to develop an additional 2,170 acres of irrigated agriculture, and
  to upgrade and extend the existing irrigation delivery and distribution system.
  There is evidence that the land proposed for additional agriculture on the Reservation
  is contaminated. Water from drains recently constructed on this land contains elevated
  levels of various elements potentially hazardous to fish and wildlife. Water draining
  this land enters the Stillwater Wildlife Management Area. The project would also
  place additional water demands upon the Truckee River and Pyramid Lake. For the
  above reasons, the USFWS opposes the Proposed Action and Construction alternatives.
  The only alternative the Service can support is the Land Acquisition alternative.
  Under this alternative, lands already in production would be acquired and no additional
  withdrawals would be required from the Truckee River.\",\n\t\"license_title\": \"License
